import { data } from "autoprefixer";

export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: 'comName',
    Cell: ({row})=>{
      const testProp = (description)=>{
        console.log(description)
      }
      return(
        <td onClick={()=>testProp(data.id)}>{data.id}</td>
      )
    }
    
    
  },
  {
      Header: "Scientific Name",
      accessor: 'sciName'
  },
  {
      Header: "Location",
      accessor: 'locName'
  },
  {
      Header: "Date",
      accessor: 'obsDt'
  }
];
